import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Notes from './routes/Notes'
import Create from './routes/Create'

function App() {
  return (  
      <Routes>
        <Route exact path="/">
          <Notes />
        </Route>
        <Route path="/create">
          <Create />
        </Route>
      </Routes>


  );
}

export default App;
